import React from 'react';
import { Container, Label } from './styles';

export default function Card() {
  return (
    <Container>
      <header>
        <label color='#7159c1' />
      </header>
      <p>Fazer migração completa do Servidor.</p>
      <img src="https://www.google.com/search?q=imagens+avatar&safe=off&sxsrf=ACYBGNT7ovIRTS_PeRLp2XcqSPCuziD6FQ:1568055689187&source=lnms&tbm=isch&sa=X&ved=0ahUKEwi97d3StsTkAhWkILkGHcLkCMEQ_AUIEigB&biw=1366&bih=615#imgrc=apQI5U58Degg5M:" alt=""/>
    </Container>
  );
}
